(1, 'Classic', 'Larger than your average bathtub, the Bette Classic allows you to stretch out and relax in total comfort. With a deep aspect of 45cm, it is also the ideal bathtub for the taller amongst us. Suitable for use with a matching skirt and surround, or a tiled panel option, the Bette Classic keeps things nice and simple to act as an adaptable unit for a range of bathroom designs and contexts.', 'classic', 'classic2.jpg', '2019-11-19 19:37:09', '2019-10-23 16:09:53'),
(2, 'Modern', 'Modern Baths are the centrepiece of any bathroom. It\'s where you get the chance to relax after a long day and come out feeling as good as new. Baths come in all sizes from small to large, wide and deep so browse our huge collection to find your perfect bath', 'modern', 'cat_2.jpg', '2019-11-19 19:38:22', '2019-10-23 16:10:27'),
(3, 'Unique', '<p>Utilizing new technologies, Unique Bath Design can also improve a bathroom’s safety and accessibility with one of our easy access showers, walk-in tubs, or roll in showers. All products are ADA compliant and customized for the bather’s level of mobility. For the bather who seeks a more therapeutic bathing experience, Unique Bath Design offers a deep relaxing soaker or whirlpool tub with directional water jets for the ultimate in comfort<br></p>', 'unique-bath', 'cat_3.jpg', '2019-11-19 19:41:34', '2019-10-23 16:11:19');

