(1, 28, 'Our Story ...', '<p style=\"text-align: left;\">B\"H</p><p style=\"text-align: left;\">All of you great photographer, Amara, Wayfair and of course Google Images. DONT Worry :) all content is just for my final project (ecommerce + admin panel using Laravel)</p><p style=\"text-align: left;\">There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary,</p><p><img src=\"data:image/jpeg;base64,\" data-filename=\"camptin.jpg\" style=\"text-align: center; width: 100%; float: left;\" class=\"note-float-left\"> </p> <br><br>', '2019-11-19 19:34:02', '2019-11-07 00:00:00');
INSERT INTO `contents` (`id`, `menu_id`, `ctitle`, `carticle`, `updated_at`, `created_at`) VALUES
(3, 27, 'Master the Art of Overestimation', '<div>Design requires time. A student in design should know early on that every project or assignment that will be required during the course of study cannot be done overnight. Most often than not, projects will be assigned&nbsp; ahead of time and will require days or even weeks and months to complete, depending on the difficulty of the subject matter.</div><div><br></div><div>Train yourself to overestimate the amount of time needed for each project.&nbsp; An important tip for design students is to never eyeball the amount of time you think you will need. If by chance you finish the project before your estimated time, then you will have extra time to do other things or review and improve what you have just completed.</div><div><br></div><div>When you land a career in design, you will find that overestimation will save you time, allow you to be detail-oriented and be more efficient in your responsibilities.</div><div><br></div><div><br></div><div>Read more at <a href=\"https://visme.co/blog/tips-design-students/#3QWSB9kMc1aWsz4L.99\" target=\"_blank\">https://visme.co/blog/tips-design-students/#3QWSB9kMc1aWsz4L.99</a></div>', '2019-11-19 19:51:00', '2019-11-07 00:00:00'),
(13, 27, '10 Things You Should Know About Design and Design Thinking', '<div>1. Design is a process</div><div>Design is an approach to problem-solving that applies the cognitive activities of design thinking. These are the processes designers leverage to ideate and create solutions.</div><div><br></div><div>Paula Sirar, design thinking advocate defines it like this, “Design Thinking is a creative process of thinking backwards from people, that leads to design of a service, a product or [something] else, based on the conclusions of the knowledge gathered in the process.”</div><div><br></div><div>2. Design is messy</div><div>During the design process, there is no straight path from point A to point B. Instead, think of squiggly scribbles leading to a final destination after many detours.</div><div><br></div><div>Roger Martin, author and Dean of the Rotman School of Management, says that design thinking involves “integrative thinking: the ability to exploit opposing ideas or constraints to create entirely new solutions.” That process can be messy.</div><div><br></div><div>3. Design requires empathy</div><div>Design involves putting yourself in the shoes of the user, whether it is a customer or a learner. It means seeing the world through their eyes. Effective designs shift the thinking from technology or objects to people. It’s based on what humans need to improve their situation— to make things better and easier.</div><div><br></div><div>4. Design solutions are based on context</div><div>Effective designs involve thinking about the context in which they will be used. Good design observes people in context. It requires thinking, “How will people use this object?” or “In what environment will people use this course?”</div>', '2019-11-19 19:48:01', '2019-11-17 10:25:17');

