(2, 1, 'Triple Toothbrush Holder - White', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Bring the subtle elegance of monochrome styling to your bathroom with this toothbrush holder from Aquanova’s Triple collection. With a white polyresin body and matt black details, its contemporary styling will suit any bathroom</span>', '2019.11.19.20.17.53-prd_6.jpg', 'triple-toothbrush-holder---white', 18, '2019-11-19 18:17:53', '2019-10-28 08:24:01'),
(3, 2, 'Cleo Soap Dish - Cool Grey', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Keep your soap safe in stylish design with this charming soap dish from Aquanova. Made from ceramic with luxurious rubber coating, this dish has draining holes and a beautiful curvaceous shape. Perfect for use in the bathroom or at the kitchen sink, team with matching pieces available separately to complete the look</span>', '2019.11.19.19.03.40-03.jpg', 'cleo-soap-dish---cool-grey', 15, '2019-11-19 18:07:45', '2019-10-28 08:24:01'),
(4, 2, 'Amazing Leds Lights Inspire Colorized', '<p>Amazing led add a lot of your bath deign&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 1rem;\">mirror and is perfect for storing bathroom essentials. Pair this storage unit with more bathroom accessories from Umbra to stylishly coordinate your space.</span></p>', '2019.11.19.20.21.12-prd_5.jpg', 'amazing-leds-lights-inspire-colorized', 64, '2019-11-19 18:36:48', '2019-10-28 08:24:01'),
(5, 3, 'CUBIKO STORAGE MIRROR', '<span style=\"color: rgb(50, 55, 64); font-family: futura-pt, Arial, sans-serif; font-size: 18px;\">A mirror designed to make the most of small space living. Tucked behind the profile of the mirror are</span><br>', '2019.11.19.20.23.13-04.jpg', 'cubiko-storage-mirror', 53, '2019-11-19 18:23:13', '2019-10-28 08:24:01'),
(6, 3, 'Mirror Decks', 'Mirror Deck is wonderful design to your bath', '2019.11.19.20.14.35-01.jpg', 'mirror-decks', 52, '2019-11-19 18:14:36', '2019-10-28 08:24:01'),
(7, 1, 'FUWL Cage Mirror - White', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Infuse your bathroom space with the sleek Danish design of this FUWL Cage mirror from MENU. Set apart from the wall in a floating design if viewed from the front, this mirror is plain in design</span>', '2019.11.19.19.06.58-05.jpg', 'fuwl-cage-mirror---white', 28, '2019-11-19 18:08:13', '2019-10-28 08:24:01'),
(8, 1, 'Tap TH', 'Tap is TH which mean The tap we\'ve picked', 'prd_1.jpg', 'tap-th', 28, '2019-11-19 17:08:47', '2019-10-28 08:24:01'),
(9, 1, 'Soap Pump - White', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Create sophisticated style in your home with this soap pump from MENU. Designed in white with a matt finish, its subtle elegance perfectly complements the brushed steel lid. Simply touch the lid to dispense soap, and tip forward to allow for easy refill.</span>', '2019.11.19.19.10.39-06.jpg', 'soap-pump---white', 60, '2019-11-19 18:08:27', '2019-10-28 08:24:01'),
(10, 1, 'Toilet Brush - Black', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Add practical style to your home with this toilet brush from MENU. Formed of stainless and powder coated steel, its stylish container has a low centre of gravity to provide it with firm stability. A comfortable grip handle makes usage easy, while its plastic inner is simple</span>', '2019.11.19.19.11.47-07.jpg', 'toilet-brush---black', 70, '2019-11-19 18:08:41', '2019-10-28 08:24:01'),
(11, 1, 'Towel Rail - Oak - Small', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Give your bathroom a much-needed refresh with this Mezza towel rail from Wireworks. Crafted from solid oak, this towel rail features three generously spaced rails, perfect for holding you</span>', '2019.11.19.19.12.42-08.jpg', 'towel-rail---oak---small', 120, '2019-11-19 18:08:51', '2019-10-28 08:24:01'),
(12, 1, 'Wooden Towel Rail - Oak', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">The basics needn’t be boring. Made from sustainably harvested oak, this towel rail has a water resistant lacquer with invisible wall fixings for a minimalist look.</span>', '2019.11.19.19.13.12-09.jpg', 'wooden-towel-rail---oak', 45, '2019-11-19 18:09:02', '2019-10-28 08:24:01'),
(13, 1, 'London Towel - Sand - Bath Sheet', '<span style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif;\">Wrap yourself in luxury after a relaxing bath with this London towel from Aquanova. Wonderfully soft and ultra-absorbent, this towel will have you dry in no time at all. This cosy essential is available in a beautiful sand colour that will complement a range of interiors.</span>', '2019.11.19.19.15.34-12.jpg', 'london-towel---sand---bath-sheet', 30, '2019-11-19 18:10:09', '2019-10-28 08:24:01'),
